import './App.css';
import Clock from './components/Clock';
import Task from './components/Task';

function App() {
  return (
    <div id='main' >

      <div id='header'>
        <h1>
          <Task></Task> Welcome to Live to Learn <span> </span><Clock></Clock>
        </h1>  
      </div>

      <div id='left'>
        <div id='upperleft'></div>
        <div id='lowerleft'></div>
      </div>

      <div id='right'>
        <div id='upperRight'></div>
        <div id='lowerRight'></div>
      </div>

      <div id='content'></div>

      <div id='footer'></div>
    </div>    
  );
}

export default App;
